import history from '../../../history'
import './signup.css'

export default function Signup() {

    const closeDiv = () => {
        if (window.confirm('Are you sure you want to close this window?'))
            history.push('/login')
    }

    return (
        <>
            <div className='Signup-background'></div>
            <div className='Signup'>
                <div className='Signup-close-div'>
                    <button className="btn-close" aria-label="Close" id='Signup-close-button' onClick={closeDiv} title='Close'></button>
                </div>
                <h5 className='Signup-title' title='Add A New Coupon'>Add A New Coupon</h5>
            </div>
        </>
    )
}
